import styled from 'styled-components';


export const SbContainer = styled.div`
    /* position: absolute; */
    z-index: 999;
    /* width: 70%; */
    height: 100%;
    background:hsl(257, 27%, 26%);
    display: flex;
    align-items: center;

    left: 0;
    border-radius: 15px;
    opacity: ${({ isOpen }) => (isOpen ? '100%' : '0')};
    top: ${({ isOpen }) => (isOpen ? '0' : '-100%')};
`
export default SbContainer
